style.css:
@-moz-document domain("docs.google.com") {
#docs-header:not(.docs-hub-appbar) .docs-titlebar-buttons {
  	background: #1d1e1f;
	}

	.kix-appview-editor, #docs-chrome:not(.docs-hub-chrome) {
		background-color: #1d1e1f !important;
	}

	.docs-grille-gm3 .docs-title-input {
  	color: #1d1e1f;
	}

	/* Search icon and Mode switcher */
	.docs-grille-gm3 #docs-omnibox-toolbar .docs-omnibox-input, .docs-grille-gm3.docs-gm #docs-toolbar-mode-switcher {
  	background: #2a2b2c !important;
	}

	/* Turn in button */
	.docs-material #docs-script-button-bar .jfk-button {
  	background-color: rgba(255,255,255,.04);
  	color: rgba(255,255,255,.54);
	}

	/* Share button */
	.docs-grille-gm3 #docs-titlebar-share-client-button .jfk-button, .docs-grille-gm3 #scb-quick-actions-menu-button.goog-flat-menu-button {
  	background: #a0b0d0;
	}

	/* Toolbar hover */
	.goog-control-hover, .goog-control-open {
  	background-color: #2a2b2c !important;
	}

	span#docs-title-input-label-inner {
  	color: white;
	}

	.docs-grille-gm3 .docs-menubar .goog-control {
  	color: gray;
	}


	/* Something and word count */
	.docs-grille-gm3.docs-gm .docs-material #docs-toolbar-wrapper, .kix-documentmetrics-widget {
		background-color: #2a2b2c;
	}

	/* Word count text */
	.docs-material-gm-select-caption {
  	color: white;
	}

	.docs-grille-gm3 #docs-align-palette .goog-toolbar-button, .docs-grille-gm3 .docs-main-toolbars .goog-toolbar-button, .docs-grille-gm3 .docs-main-toolbars .goog-toolbar-combo-button, .docs-grille-gm3 .docs-main-toolbars .goog-toolbar-menu-button, .docs-grille-gm3 .trix-palette .goog-toolbar-menu-button {
  	background-color: #2a2b2c;
  	color: white;
	}

	.docs-icon.goog-inline-block {
  	filter: brightness(3);
	}
}
